import React, { useEffect, useState } from 'react';
import { Card, Col, Row } from 'antd';
import axios from 'axios';

function App() {
  const [countPP, setCountPP] = useState(0);
  const [countMaquinas, setCountMaquinas] = useState(0);
  const [countMoldes, setCountMoldes] = useState(0);
  const [countMP, setCountMP] = useState(0);

  const fetchData = async (url, setter) => {
    try {
      const response = await axios.get(url);
      setter(response.data.count);
    } catch (error) {
      console.error(error);
    }
  };

  useEffect(() => {
    fetchData('http://localhost:8080/api/count/countPP', setCountPP);
    fetchData('http://localhost:8080/api/count/countMaquinas', setCountMaquinas);
    fetchData('http://localhost:8080/api/count/countMoldes', setCountMoldes);
    fetchData('http://localhost:8080/api/count/countMP', setCountMP);
  }, []);

return (
    <div style={{ background: '#ECECEC', padding: '30px' }}>
      <Row gutter={22}>
        <Col span={8}>
          <Card style={{ minHeight: 200 }} title="Default Parameters" bordered={false}>
            {countPP}
          </Card>
        </Col>
        <Col span={8}>
          <Card style={{ minHeight: 200 }} title="Machines" bordered={false}>
            {countMaquinas}
          </Card>
        </Col>
        <Col span={8}>
          <Card style={{ minHeight: 200 }} title="Molds" bordered={false}>
            {countMoldes}
          </Card>
        </Col>
      </Row>
      <Row gutter={22}>
        <Col span={8}>
          <Card style={{ minHeight: 200 }} title="Raw Material" bordered={false}>
            {countMP}
          </Card>
        </Col>
      </Row>
    </div>
  );
}

export default App;
